    return (
        <div>
            <NavBar toLink="/ProfilePage" Page="MyProfilePage"/>
            <ul className="list-group">
            {
               props.ArrMyOrder.map((e,index)=>{
                   <h1>Order {index} :</h1>
                   e.map(e=>{
                    console.log(e)
                    return   <EachLine type="PaymentPage" e={e} />
                   })
                })
            }
            </ul>
        </div>
    )
}
